    [],nt"num_tags": 29,nt"name": "ohio-river-islands-national-wildlife-refuge-annual-narrative-report-calendar-year-1994",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Ohio River
    Islands National Wildlife Refuge outlines Refuge accomplishments during the 1994
    calendar year. The report begins with a summary of the year's highlights and weather
    conditions. Land acquisition is covered. The report includes a planning section
    which discusses the management plan, public participation, compliance with environmental
    and cultural resource mandates, and research and investigations. Refuge administration
    is outlined; information about personnel, youth programs, volunteer programs, funding,
    safety, and technical assistance is given. The wildlife section of the report discusses
    wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
    waterbirds, shorebirds, and raptors. The public uses of the Refuge described in
    this report include interpretive programs, hunting, fishing, and law enforcement.
    The equipment and facilities section of the report provides information about major
    maintenance, equipment replacement, communication systems, computer systems, and
    energy conservation. Items of interest are provided at the end.",nt"owner_org":
